                    {
                        item.Quadrant = QuadrantParse;
                    }
                    else
                    {
                        item.Quadrant = default(AlphaLayer.QuadrantEnum);
                    }
                    item.LayerNumber = dataFrame.ReadUInt16();
                    return TryGet<int?>.Succeed((int)BaseLayer_FieldIndex.LayerNumber);
                }
                default:
